Il cherche dans l’himen de cette illuſtre Fille
L’appui du grand credit, où ſe voit ſa famille;
Je ne reçois rien d’elle, & j’en ſuis en ſouci,

Mais ce qui plus me plaît, d’une atteinte ſi chere,
C’eſt que pour étre Roi, le Ciel nous rend ce Frere;
Et qu’ainſi mon amour peut éclater au moins
Sans qu’à d’autres motifs on impute ſes ſoins;
